  height: 2rem;
  background-color: #fff;
  border-bottom: 1px solid gray;
`

export function Header() {
  return (
    <HeaderSection>
      <div>
        <img src={logo} alt="Logo Metallum"></img>
        <ul>
          <li></li>
          <li></li>
          <li></li>
        </ul>
      </div>
    </HeaderSection>
  )
}
